import React from "react";
import Card from "react-bootstrap/Card";


const Home = () => {
	return (
		<div className="page">
			<h1>Home Page</h1>
			<p>This is the home page.</p>


			<Card>
				<Card.Body>This is some text within a card body.</Card.Body>
			</Card>

		</div>
	);
};

export default Home;
